## FENIX 7 PRO
## WITH SOLAR CHARGING ALL DAY, EVERY DAY
- Conquer every hour with advanced training features, 24/7 health and wellness monitoring, and up to more than a month of battery life with the Power Glass solar charging lens1 and a rugged watch case designed for smaller wrists.
- LONG BATTERY LIFE WITH Get up to in smartwatch mode with solar charging in 3 hours of direct sunlight (50,000 lux) per day and up to 46 hours in GPS mode with solar charging (assumes continuous use for entire period in 50,000 lux conditions).


### BUILT-IN LED FLASHLIGHT
Variable light intensities and a red safety light give you greater awareness while you train in the dark and can provide convenient illumination when you need it. Strobe mode can even match your running cadence.

### HILL SCORE
This feature measures your capability for running uphill and evaluates your progress over time based on your VO2 max and training history. It measures your running strength on steep ascents and running endurance on long ascents and provides a score based on your performance over time.

### ENDURANCE SCORE
This feature measures your ability to sustain prolonged efforts and combines training data from all your athletic pursuits to help you understand how training impacts your overall endurance. This dynamic measurement uses your VO2 max, short-term/long-term training loads and other factors to gauge your fitness progress beyond just VO2 max.

### RUGGED BY DESIGN
The resilient athletic design features a 1.2" solar charged display, responsive touchscreen, traditional buttons and 42 mm fiber-reinforced polymer case with a steel bezel and rear cover. The watch is tested to U.S. military standards for thermal, shock and water resistance.

### KNOWLEDGE IS POWER
Your health and training data should be easy to interpret and provide actionable insight. Begin each day with a customizable morning report, and see a daily summary of health and wellness information. Use the training readiness feature - which looks at a variety of different health metrics to help you maximize your training efficiency and recovery2 - to prevent burnout.

### PERFORMANCE FEATURES

- VISUAL RACE PREDICTOR
-- Get an estimate of what your pace could be for a 5K, 10K, half-marathon and marathon.

- PACEPRO TECHNOLOGY
-- Plan race-day strategy with GPS-based pace guidance for a selected course or distance.

- CLIMBPRO FEATURE
-- See real-time information on your current and upcoming climbs on downloaded courses.

- GRADE-ADJUSTED PACE
-- Get your equivalent running pace at the same effort on flat ground or when ascending.

- TRAINING READINESS
-- From the moment you wake up, get a readiness score based on your sleep quality2, recovery, training load and more, so you can determine whether it's a good day to go hard - or take it easy.

- TRAINING STATUS
-- Get insight, and know whether you're training productively, peaking or strained.

- PERFORMANCE METRICS
-- Gauge your performance with advanced training metrics such as VO2 max, training load and more.

- REAL-TIME STAMINA
-- Prevent burnout, and use this data to track and manage your exertion

- DAILY SUGGESTED WORKOUT
-- View your entire week of daily suggested workouts, which adapt after every run or ride.

- RECOVERY TIME
-- Know how long you need to recover before your next high-effort workout based on your latest training.

- RACE WIDGET
-- Prepare for your next race with training tips, personalized daily suggested workouts and more

- WRIST-BASED RUNNING POWER
-- See how much power you're applying to the trail or road so you can manage effort and fine-tune training.

- GARMIN COACH
-- Get free adaptive 5K, 10K and half-marathon training plans from expert coaches.

## ACTIVITY FEATURES

- TRACK YOUR ACTIVITIES
-- Use preloaded activity profiles to get data and insight from your active pursuits. You can now track team sport activities such as soccer, football, racquet sports and more.

- HIIT WORKOUTS
-- Track your HIIT workouts, including AMRAP, EMOM, Tabata or custom workouts.

- ANIMATED WORKOUTS
-- Follow animated cardio, strength, yoga and Pilates workouts on the watch screen.

- BACKCOUNTRY SKI AND SNOWBOARD
-- Get ascent and descent data along with metrics such as cadence, stride length and grade.

- XC SKI DYNAMICS
-- Measure exercise load when paired with an HRM-Pro Plus chest strap (sold separately).

- SURF ACTIVITY
-- Record the number of waves surfed, maximum speed reached, distance traveled and more.

- SURFLINE CAMERA
-- Create a video of every wave you ride in front of a Surfline camera with Surfline Sessions technology. Use the Surfline widget to see tide, wave height, wind and surf rating for each of the five nearest surf spots3.

- MTB DYNAMICS
-- Track the details of your ride with specialized Grit and Flow measurements.

- NAVIGATION FEATURES
-- OUTDOOR MAPS+
Subscribe to Outdoor Maps+ for premium mapping content, such as satellite imagery and enhanced topographic maps, downloaded directly to your watch.
- 
-- SATIQ TECHNOLOGY
Get superior positioning accuracy with multi-band GPS while optimizing battery life.
- 
-- ABC SENSORS
Navigate your next trail with an altimeter, barometer and 3-axis electronic compass.
- 
-- MULTICONTINENT TOPO MAPS
Download TopoActive maps from around the world to keep your explorations on track. Use built-in Wi-Fi connectivity to easily load and update maps without using a computer.
- 
-- SKIVIEW MAPS
View run names and difficulty ratings for more than 2,000 ski resorts worldwide.
- 
-- GOLF COURSE MAPS
Get preloaded full-color CourseView maps for more than 43,000 golf courses around the world.
- 
-- NEXTFORK MAP GUIDE
Navigate with a quick glance, and see the distance to the next intersection and the trail name.
- 
-- UP AHEAD FEATURE
Get at-a-glance awareness for selected POI checkpoints ahead - such as aid stations - during a race.
- 
-- ROUND-TRIP ROUTING
Enter how far you want to go, and get suggested routes that will bring you back; even use TrendLine routing to find the best local paths.
- 
-- COURSES WITH TURN-BY-TURN DIRECTIONS
Create or find existing courses in the Garmin Connect smart-device app, or sync from your favorite third-party platforms and get turn-by-turn directions.

### HEALTH FEATURES

- MORNING REPORT
-- Get a customizable overview of your sleep, training outlook, HRV status, weather and more as soon as you wake up.

- HRV STATUS
-- Gain a better understanding of your overall health, recovery and training performance while you sleep.

- WRIST-BASED HEART RATE
-- The watch constantly samples your heart rate2 to help you gauge how hard you work during activities.

- PULSE OX SENSOR
-- Track your blood oxygen saturation while you're awake or asleep, and gain awareness of how you're adapting to altitude4.

- SLEEP MONITORING AND SLEEP SCORE
-- Understand your body's recovery with sleep score, breakdown of your sleep stages and detailed insights for improved sleep quality2.

- JET LAG ADVISER
-- Help to minimize the effects of jet lag with guidance on light exposure, sleep schedule and exercise.

- BODY BATTERY ENERGY MONITORING
-- Track your body's energy levels to find the best times for activity and rest2.

- STRESS TRACKING
-- See if you're having a calm, balanced or stressful day.

- STRESS TRACKING
-- See if you're having a calm, balanced or stressful day.

- WOMEN'S HEALTH TRACKING
-- Track and log your menstrual cycle or pregnancy to get exercise and nutrition education.

### CONNECTED FEATURES

- SMART NOTIFICATIONS
-- Receive emails, texts and alerts on your watch when paired with your iPhone or Android smartphone.

- MUSIC
-- Download songs and playlists from your Spotify, Deezer or Amazon Music accounts for phone-free listening.

- GARMIN PAY CONTACTLESS PAYMENTS
-- Breeze through checkout lines or transit systems with participating providers.

- SAFETY AND TRACKING FEATURES
-- If you feel unsafe or if your watch senses that an incident occurred, your watch will send a message with your live location5.

- STOCKS TRACKER
-- Keep track of up to 50 of your favorite stocks6 - right from your wrist.

- CONNECT IQ STORE
-- Add watch faces, data fields and apps to your paired watch.

- POWER MANAGER
-- View how various settings and sensors impact your watch's battery life.



